USE `elixiatech`;
DROP procedure IF EXISTS `insert_docket`;

DELIMITER $$
USE `elixiatech`$$
CREATE PROCEDURE `insert_docket`(
    IN customerNoParam INT(11),
    IN raiseOnDateTimeParam DATETIME,
    IN timestampParam DATETIME,
    IN purposeIdParam VARCHAR(20),
    IN interactionIdParam TINYINT(2),
    IN createByParam INT(11),
    IN teamIdParam INT(11),
    IN iTypeParam TINYINT(2),
    IN responseParam TINYINT(2),
    OUT isExecutedOut TINYINT(2),
    OUT docketId INT(11)
)
BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
       BEGIN
           ROLLBACK;
             /*GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE,
           @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
           SET @full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
           SELECT @full_error;  */
           SET isexecutedOut = 0;
       END;

        SET isexecutedOut = 0;

       START TRANSACTION;
       BEGIN
            INSERT INTO docket (customerno, raiseondate,timestamp,purpose_id,interaction_id,team_id,create_by,i_type,response)
            VALUES (customerNoParam,raiseOnDateTimeParam,timestampParam,purposeIdParam,interactionIdParam,teamIdParam,createByParam,iTypeParam, responseParam);
          SET isExecutedOut = 1;
          SET docketId = LAST_INSERT_ID();
       END;
       COMMIT;
END$$

DELIMITER ;

USE `elixiatech`;
DROP procedure IF EXISTS `edit_docket`;

DELIMITER $$
USE `elixiatech`$$
CREATE PROCEDURE `edit_docket`(
    IN customerNoParam INT(11),
    IN raiseOnDateTimeParam DATETIME,
    IN timestampParam DATETIME,
    IN purposeIdParam VARCHAR(20),
    IN interactionIdParam TINYINT(2),
    IN createByParam INT(11),
    IN teamIdParam INT(11),
    IN iTypeParam TINYINT(2),
    IN responseParam TINYINT(2),
  IN docketIdParam INT,
    OUT isExecutedOut TINYINT(2)
)
BEGIN
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
       BEGIN
           ROLLBACK;
             /*GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE,
           @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
           SET @full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
           SELECT @full_error;  */
           SET isexecutedOut = 0;
       END;

        SET isexecutedOut = 0;

       START TRANSACTION;
       BEGIN
       UPDATE `docket` SET
            `customerno`= customerNoParam,
            `timestamp`= timestampParam,
            `purpose_id`=purposeIdParam,
            `interaction_id`=interactionIdParam,
            `team_id`=teamIdParam
             WHERE docketid = docketidParam;

            INSERT INTO docket_history (docketid,customerno, raiseondate,timestamp,purpose_id,interaction_id,team_id,create_by,i_type,response)
            VALUES (docketIdParam,customerNoParam,raiseOnDateTimeParam,timestampParam,purposeIdParam,interactionIdParam,teamIdParam,createByParam,iTypeParam, responseParam);

            SET isExecutedOut = 1;
       END;
       COMMIT;
END$$

DELIMITER ;

USE `elixiatech`;
DROP procedure IF EXISTS `insert_ticket`;

DELIMITER $$
USE `elixiatech`$$
CREATE PROCEDURE `insert_ticket`(

    IN titleParam VARCHAR(250)

    ,IN typeidParam INT(11)

    ,IN pridParam INT(11)

    ,IN descParam VARCHAR(255)

    ,IN useridParam INT

    ,IN customerNoParam INT

    ,IN todaysdateParam DATETIME

    ,IN allottoParam INT(11)

    ,IN raiseondateParam DATETIME

    ,IN expecteddateParam DATE

    ,IN mailStatusParam TINYINT(2)

    ,IN ticketmailidParam VARCHAR(255)

    ,IN ccemailidParam VARCHAR(255)

    ,IN createdbyParam INT(11)

    ,IN relmgrParam INT(11)

    ,IN platformParam TINYINT(2)

    ,IN lteamidParam INT

    ,IN prodIdParam INT

    ,IN docketIdParam INT

    ,IN ecdToBeUpdatedByParam DATETIME

    ,OUT isexecutedOut INT

    ,OUT currentTicketId INT(11)

    ,OUT tickettypenameOut VARCHAR(100)

  ,OUT customercompanyOut VARCHAR(100)

    ,OUT prioritynameOut VARCHAR(100)

    ,OUT allottoemailOut VARCHAR(50)

  ,OUT createbyOut VARCHAR(100)

    ,OUT departmentIdOut VARCHAR(25)
)
BEGIN

    DECLARE crmTeamId INT;

    DECLARE relManager INT;

    DECLARE EXIT HANDLER FOR SQLEXCEPTION

    BEGIN

            ROLLBACK;


/*
            GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE,

            @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;

            SET @full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);

            SELECT @full_error;

            SET isexecutedOut = 0;

*/

    END;



    BEGIN

        IF(relmgrParam = 0 OR relmgrParam = '') THEN

            SET relmgrParam = null;

        END IF;

        IF typeidParam <> '' THEN

            SELECT  tickettype

            INTO    tickettypenameOut

            FROM    sp_tickettype

            WHERE   typeid = typeidParam

            AND     isdeleted = 0 ;

        END IF;



        IF pridParam <> '' THEN

            SELECT  priority

            INTO    prioritynameOut

            FROM    sp_priority

            WHERE   prid = pridParam

            AND     isdeleted = 0 ;

        END IF;



        SELECT  email

        INTO    allottoemailOut

        FROM    team

        WHERE   teamid = allottoParam;

        SELECT  customercompany

        INTO    customercompanyOut

        FROM    customer

        WHERE   customerno = customerNoParam;

    SELECT  name

        INTO    createbyOut

        FROM    team

        WHERE  teamid = createdbyParam;

    SELECT d_id

        INTO departmentIdOut

        FROM team

        WHERE teamid = createdbyParam;


        IF (customerNoParam IS NOT NULL OR relmgrParam IS NULL) THEN

            SELECT

                c.rel_manager INTO relManager

            FROM customer c

            WHERE c.customerno = customerNoParam

            ;



        END IF;



        IF(coalesce(relManager,0) = 0)THEN

            SET relmgrParam = 28;

        ELSE

            SELECT

                T.teamid INTO crmTeamId

            FROM team t

            WHERE t.rid = relManager

            ;

            SET relmgrParam = crmTeamId;

        END IF;



        SET currentTicketId = 0;

        SET isexecutedOut = 0;

        START TRANSACTION;

        BEGIN



            INSERT INTO `sp_ticket`(

                    `title`

                    ,`ticket_type`

                    ,`customerid`

                    ,`send_mail_status`

                    ,`send_mail_to`

                    ,`send_mail_cc`

                    ,`priority`

                    ,`raised_on_date`

                    ,`create_on_date`

                    ,`create_by`

                    ,`create_platform`

                    ,`uid`

                    ,`crmid`

                    ,`prodId`

                    ,`eclosedate`

          ,`docketid`

                    ,`estimateddate`
                    )

            VALUES (

                    titleParam

                    ,typeidParam

                    ,customerNoParam

                    ,mailStatusParam

                    ,ticketmailidParam

                    ,ccemailidParam

                    ,pridParam

                    ,raiseondateParam

                    ,todaysdateParam

                    ,createdbyParam

                    ,platformParam

                    ,useridParam

                    ,relmgrParam

                    ,prodIdParam

          ,expecteddateParam

          ,docketIdParam

                    ,ecdToBeUpdatedByParam
                    );



            SET currentTicketId = LAST_INSERT_ID();



            IF(currentTicketId != 0) THEN

                INSERT INTO `sp_ticket_details`(`ticketid`

                    ,`description`

                    ,`allot_from`

                    ,`allot_to`

                    ,`status`

                    ,`create_by`

                    ,`create_on_time`

                    ,`userid`

                    )

                VALUES (currentTicketId

                    ,descParam

                    ,lteamidParam

                    ,allottoParam

                    ,0

                    ,createdbyParam

                    ,todaysdateParam

                    ,useridParam

                    );

                SET isexecutedOut = 1;

            END IF;

        END;

        COMMIT;

    END;

END$$

DELIMITER ;

USE `elixiatech`;
DROP procedure IF EXISTS `update_ticket_team`;

DELIMITER $$
USE `elixiatech`$$
CREATE  PROCEDURE `update_ticket_team`(
    IN customerNoParam INT
    ,IN priorityParam INT
    ,IN sendMailParam INT
    ,IN emailIdsParam VARCHAR(100)
    ,IN ccemailidsParam VARCHAR(100)
    ,IN ecloseDateParam DATE
    ,IN addCountParam INT
    ,IN ticketIdParam INT
    ,IN ticketDescParam VARCHAR(255)
    ,IN allotFromParam INT
    ,IN allotToParam INT
    ,IN ticketStatusParam INT
    ,IN createdByParam INT
    ,IN createdOnTimeParam DATETIME
    ,IN createdTypeParam INT
    ,IN prodIdParam INT
    ,OUT ticketIdOut INT
    ,OUT is_executedOut INT
    ,OUT tickettypenameOut VARCHAR (20)
    ,OUT customercompanyOut VARCHAR (20)
    ,OUT prioritynameOut VARCHAR (20)
    ,OUT allottoemailOut VARCHAR (50)
    ,OUT createbyOut VARCHAR (50)
)
BEGIN
  DECLARE typeidParam INT;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
       /*
     ROLLBACK;
       GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE,
        @errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
        SET @full_error = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
        SELECT @full_error;
        */
    END;
    START TRANSACTION;


        IF (customerNoParam = 0) THEN
            SET customerNoParam = NULL;

        END IF;

        IF (customerNoParam IS NOT NULL ) THEN
            update elixiatech.sp_ticket t
            set t.priority=priorityParam ,
            t.send_mail_status=sendMailParam ,
            t.customerid=customerNoParam ,
            t.eclosedate=ecloseDateParam ,
            t.eclosedate_chng_count = t.eclosedate_chng_count + addCountParam,
            t.send_mail_to = emailIdsParam,
            t.prodId = prodIdParam
            where t.ticketid=ticketIdParam;
            IF (createdTypeParam=0) THEN
                INSERT INTO elixiatech.`sp_ticket_details`(`ticketid`, `description`, `allot_from`, `allot_to`, `status`, `create_by`, `create_on_time`)
                    VALUES (ticketIdParam, ticketDescParam, allotFromParam ,allotToParam, ticketStatusParam,createdByParam,createdOnTimeParam);
            ELSE
                INSERT INTO elixiatech.`sp_ticket_details`(`ticketid` ,`description`,`allot_from`,`allot_to`,`status`,`create_by`,`create_on_time`,`eclosedate`,`created_type`,`docketid`,`prodId`)
                    VALUES (ticketIdParam, ticketDescParam,allotFromParam ,allotToParam, ticketStatusParam,createdByParam,createdOnTimeParam,ecloseDateParam,createdTypeParam);
            END IF;
      SET is_executedOut = 1;
        END IF;

    SET ticketIdOut  = ticketIdParam;

  SELECT  priority
   INTO    prioritynameOut
   FROM    sp_priority
   WHERE   prid = priorityParam
   AND     isdeleted = 0 ;



    SELECT  email
  INTO    allottoemailOut
  FROM    team
  WHERE   teamid = allottoParam;

  SELECT  customercompany
  INTO    customercompanyOut
  FROM    customer
  WHERE   customerno = customerNoParam;

    SELECT  name
  INTO    createbyOut
  FROM    team
  WHERE   teamid = createdByParam;

    SELECT tickettype
  INTO tickettypenameOut
  from sp_tickettype
  where typeid = (SELECT ticket_type
  from sp_ticket
  where ticketid = ticketIdParam LIMIT 1);

    COMMIT;
END$$

DELIMITER ;

