USE `elixiatech`;
DROP procedure IF EXISTS `fetchBucketsForDocket`;

DELIMITER $$
USE `elixiatech`$$
CREATE PROCEDURE `fetchBucketsForDocket`(
IN  docketIdParam INT
)
BEGIN
  SELECT b.bucketid, b.apt_date, b.created_by, b.purposeid as purpose_id, b.status as statusid, t.teamid, t.name,b.priority,
    (CASE
    WHEN b.status=1
        THEN 'Rescheduled'
        WHEN b.status=2
        THEN 'Successful'
        WHEN b.status=3
        THEN 'Unsuccessful'
        WHEN b.status=4
        THEN 'FE Assigned'
        WHEN b.status=5
        THEN 'Cancelled'
        WHEN b.status=6
        THEN 'Incomplete'
  END) as status,
    (CASE
    WHEN b.purposeid=1
        THEN 'Installation'
        WHEN b.purposeid=2
        THEN 'Repair'
        WHEN b.purposeid=3
        THEN 'Removal'
        WHEN b.purposeid=4
        THEN 'Replacement'
        WHEN b.purposeid=5
        THEN 'Reinstall'
  END) as purposeid,
    (CASE
    WHEN b.priority=1
    THEN 'High'
        WHEN b.priority=2
    THEN 'Medium'
        WHEN b.priority=1
    THEN 'Low'
    END)as priority
    from speed.bucket b
    LEFT JOIN team t on b.created_by = t.teamid
    where docketid = docketIdParam;
END$$

DELIMITER ;


USE `elixiatech`;
DROP procedure IF EXISTS `fetchTickets`;

DELIMITER $$
USE `elixiatech`$$
CREATE  PROCEDURE `fetchTickets`(
IN docketIdsParam TEXT)
BEGIN

  SELECT
            st.ticketid,
            st.title,
            st.docketid,
            sttype.tickettype,
            t.name AS allot_to,
            st.create_on_date,
            sp.priority,
            ts.status as ticketStatus,
            st.eclosedate
        FROM sp_ticket as st
        INNER JOIN  sp_ticket_details std ON std.ticketid = st.ticketid
        AND std.uid = (SELECT MAX(uid) from sp_ticket_details sds where sds.ticketid=st.ticketid)
        LEFT JOIN   team t ON t.teamid = std.allot_to
        LEFT JOIN   sp_tickettype as sttype on sttype.typeid = st.ticket_type
        LEFT JOIN   sp_priority as sp on sp.prid = st.priority
        LEFT JOIN ticket_status ts ON ts.id = std.status
    WHERE FIND_IN_SET(st.docketid,docketIdsParam)
        GROUP BY    std.ticketid
        order by    st.ticketid ASC;
END$$

DELIMITER ;


USE `elixiatech`;
DROP procedure IF EXISTS `fetch_buckets`;

DELIMITER $$
USE `elixiatech`$$
CREATE PROCEDURE `fetch_buckets`(
IN docketIdsParam TEXT)
BEGIN

   SELECT b.bucketid, b.apt_date,t.name,b.docketid,b.create_timestamp,
    (CASE
    WHEN b.status=0
        THEN 'Open'
        WHEN b.status=1
        THEN 'Rescheduled'
        WHEN b.status=2
        THEN 'Successful'
        WHEN b.status=3
        THEN 'Unsuccessful'
        WHEN b.status=4
        THEN 'FE Assigned'
        WHEN b.status=5
        THEN 'Cancelled'
        WHEN b.status=6
        THEN 'Incomplete'
    END) as status,
    (CASE
        WHEN b.purposeid=1
        THEN 'Installation'
        WHEN b.purposeid=2
        THEN 'Repair'
        WHEN b.purposeid=3
        THEN 'Removal'
        WHEN b.purposeid=4
        THEN 'Replacement'
        WHEN b.purposeid=5
        THEN 'Reinstall'
    END) as purposeid,
    (CASE
        WHEN b.priority=1
        THEN 'High'
        WHEN b.priority=2
        THEN 'Medium'
        WHEN b.priority=1
        THEN 'Low'
    END)as priority
    from speed.bucket b
    LEFT JOIN team t on b.created_by = t.teamid
    where FIND_IN_SET(docketid,docketIdsParam);

END$$

